import logo from './logo.svg';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import './App.css';



import Home  from './Home';
import Home2 from './Home2';

function App() {





  return (
    <>
    <Router>
      <Routes>

        <Route path="/" element={<Home />} />
        <Route path="/home2/:id" element={<Home2 />} />




      </Routes>
    </Router>





    </>

  );
}

export default App;
